// src/SearchBar.js
import React from "react";

const SearchBar = ({ search, setSearch }) => {
  return (
    <div className="search-box">
      <input
        type="text"
        value={search}
        placeholder="Search products..."
        onChange={(e) => setSearch(e.target.value)}
      />
    </div>
  );
};

export default SearchBar;
